import React from "react"
import "./home.css"



const Home = () => {

  function setup(e) {
    e.preventDefault();
    console.log('You clicked setuo.');
  }

  function requestMeeting(e) {
    e.preventDefault();
    console.log('You clicked request.');
  }

  return (

    <>
      <section className='hero'>
        <h1>Welcome Arya to TOPY Station</h1>
        <button onClick={setup}>Set up a meeting</button>
        <button onClick={requestMeeting}>Meeting Request</button>

      </section>
    </>
  )
}
export default Home
